    fun part1(ipRegister: Int, path: String): Int {
        val instructions = File(path).readLines().map { opcode(it) }
        execute(6132825, instructions, ipRegister)
        return 6132825
    }

    fun part2(ipRegister: Int, path: String): Int {
        val instructions = File(path).readLines().map { opcode(it) }
        execute(8307757, instructions, ipRegister)
        return 8307757
    }

    private fun execute(startValue: Int, instructions: List<Opcode>, ipRegister: Int): Int {
        var ip = 0
        var executedInstructions = 0
        val register = mutableListOf(startValue, 0, 0, 0, 0, 0)
        while (ip < instructions.size) {
            register[ipRegister] = ip
            instructions[ip].apply(register)
            executedInstructions++
            ip = register[ipRegister]
            ip++
        }
        return executedInstructions
    }

    private fun opcode(line: String): Opcode {
        val opcodeName = line.substring(0, 4)
        val (A, B, C) = line.substring(5).split(" ").map { it.toInt() }
        return when(opcodeName) {
            "eqri" -> Eqri(A, B, C)
            "gtrr" -> Gtrr(A, B, C)
            "gtri" -> Gtri(A, B, C)
            "eqir" -> Eqir(A, B, C)
            "eqrr" -> Eqrr(A, B, C)
            "gtir" -> Gtir(A, B, C)
            "banr" -> Banr(A, B, C)
            "setr" -> Setr(A, B, C)
            "bani" -> Bani(A, B, C)
            "seti" -> Seti(A, B, C)
            "addi" -> Addi(A, B, C)
            "mulr" -> Mulr(A, B, C)
            "addr" -> Addr(A, B, C)
            "borr" -> Borr(A, B, C)
            "bori" -> Bori(A, B, C)
            else -> Muli(A, B, C)
        }
    }

    interface Opcode {
        fun apply(register: MutableList<Int>)
    }

    class Eqrr(private val A: Int, private val B: Int, private val C: Int) : Opcode {

        private val values = mutableSetOf<Int>()

        override fun apply(register: MutableList<Int>) {
            if(register[A] in values) {
                println(values)
                exitProcess(0)
            }
            values += register[A]
            if(register[A] == register[B]) register[C] = 1 else register[C] = 0
        }
    }

    class Addr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] + register[B]
        }
    }

    class Addi(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] + B
        }
    }

    class Mulr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] * register[B]
        }
    }

    class Muli(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] * B
        }
    }

    class Banr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] and register[B]
        }
    }

    class Bani(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] and B
        }
    }

    class Borr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] or register[B]
        }
    }

    class Bori(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A] or B
        }
    }

    class Setr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = register[A]
        }
    }

    class Seti(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            register[C] = A
        }
    }

    class Gtir(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            if(A > register[B]) register[C] = 1 else register[C] = 0
        }
    }

    class Gtri(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            if(register[A] > B) register[C] = 1 else register[C] = 0
        }
    }

    class Gtrr(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            if(register[A] > register[B]) register[C] = 1 else register[C] = 0
        }
    }

    class Eqir(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            if(A == register[B]) register[C] = 1 else register[C] = 0
        }
    }

    class Eqri(private val A: Int, private val B: Int, private val C: Int) : Opcode {
        override fun apply(register: MutableList<Int>) {
            if(register[A] == B) register[C] = 1 else register[C] = 0
        }
    }
}
